import React, {Component} from 'react'
import './recepie_list.css'
import './RecepieCard'

class RecepieList extends Component{
	render(){
		return(
			<div>
				<RecepieCard
				  title = "pasta"
				  ingredients = {['flour', 'oil']}
				  instructions = "Mix all the stuff"
				  img = 'logo192.png'
				/>
			</div>
		);
	}
}

export default RecepieList;
